description:
Casting :Lana Fever - Sabrina Sweet - Cristale Rock
Lana n'en pet plus de voir sa grande soeur mener une vie de merde sous l'emprise de son mec, un gros con radin completement debile, et va faire tout ce qui est en son pouvoir pour lui ouvrir les yeux et la ramenee a la vie reelle avec l'aide de sa copine Sabrina.
Les deux petites salopes ont du pain sur la planche ! 

ReleaseDate :08/01/2013                                                         Langue     : French


